import React, { useEffect, useState } from 'react';
import { Box, Card, CardContent, CircularProgress, Table, TableBody, TableCell, TableRow, Typography, Divider  } from '@mui/material';

const CompanyInfo = ({ ticker }) => {
  const [companyData, setCompanyData] = useState(null);

  useEffect(() => {
    // Mock function to simulate data fetching
    const fetchCompanyData = async (ticker) => {
      // Replace with actual API call
      const mockData = {
        MAN: {
          name: 'ManpowerGroup Inc',
          logo: 'https://path/to/logo.png',
          price: '$70.54',
          targetPrice: 'Upgrade to view',
          volume: '426,080',
          marketCap: '$3.28B',
          yearRange: '$66.85 - $78.11',
          dividendYield: '4.49%',
          peRatio: '64.78',
        },
        AAPL: {
          name: 'Apple Inc',
          logo: 'https://path/to/apple-logo.png',
          price: '$150.54',
          targetPrice: 'Upgrade to view',
          volume: '75,080,000',
          marketCap: '$2.41T',
          yearRange: '$120.00 - $160.00',
          dividendYield: '0.60%',
          peRatio: '30.28',
        },
        // Add more mock data as needed
      };
      return mockData[ticker];
    };

    fetchCompanyData(ticker).then((data) => setCompanyData(data));
  }, [ticker]);

  if (!companyData) return <CircularProgress />;

  return (
    <Box mt={4}>
      <Card>
        <CardContent>
          <Typography variant="h5">{companyData.name}</Typography>
          <img src={companyData.logo} alt={`${companyData.name} Logo`} style={{ maxWidth: '100px', marginBottom: '16px' }} />
          <Table>
            <TableBody>
              <TableRow>
                <TableCell>Price</TableCell>
                <TableCell>{companyData.price}</TableCell>
              </TableRow>
              <TableRow>
                <TableCell>Target Price</TableCell>
                <TableCell>{companyData.targetPrice}</TableCell>
              </TableRow>
              <TableRow>
                <TableCell>Volume</TableCell>
                <TableCell>{companyData.volume}</TableCell>
              </TableRow>
              <TableRow>
                <TableCell>Market Cap</TableCell>
                <TableCell>{companyData.marketCap}</TableCell>
              </TableRow>
              <TableRow>
                <TableCell>Year Range</TableCell>
                <TableCell>{companyData.yearRange}</TableCell>
              </TableRow>
              <TableRow>
                <TableCell>Dividend Yield</TableCell>
                <TableCell>{companyData.dividendYield}</TableCell>
              </TableRow>
              <TableRow>
                <TableCell>PE Ratio</TableCell>
                <TableCell>{companyData.peRatio}</TableCell>
              </TableRow>
            </TableBody>
          </Table>
        </CardContent>
      </Card>
    </Box>
  );
};

export default CompanyInfo;
